import { addons } from "storybook/manager-api";
addons.register(ADDON_ID, (api) => {
  api.on(constants_default.REQUEST, ({ kind, name }) => {
    const id = api.storyId(kind, name);
    api.emit(constants_default.RECEIVE, id);
  });
});
